SELECT AVG(age) FROM adult WHERE  (`sex` IN ('Female'))  AND  (`capital-gain` >= 17615 AND `capital-gain` <= 25373)  AND  (`capital-loss` >= 709 AND `capital-loss` <= 1261)  AND  `education-num` + `capital-gain` <= `hours-per-week`  AND  `age` * `fnlwgt` <= `education-num`  AND  `age` * `capital-loss` >= `hours-per-week`  AND  `age` * `education-num` <= `capital-gain`  AND  `fnlwgt` + `education-num` >= `hours-per-week`  ;
